    const {user} = useAuthContext()

    
    return ( <div className="Hobnob">
       {user && <h1> Home </h1> }
       {!user && <form action="/search" method="get">
  <input type="search" id="search" name="q" placeholder="Search..."></input>
  <button type="submit">Search</button>
</form>}
    </div> 
    )
}
 
export default Home;
